import 'antd/dist/antd.css';
import '../App.css';
import { Layout } from 'antd';
import { PageLayout } from './Layout';
const { Header, Footer, Sider, Content } = Layout;

export const Reports = () => {
    return <PageLayout children={<Content>
        <div className='MainHeader'>
            <h2>Reports</h2>
        </div>
</Content>} />;
}
